// ==UserScript==
// @name         AutomationAnywhere sounds
// @namespace    http://tampermonkey.net/
// @version      0.0.4
// @description  Adds Half-Life sounds to the "RUN" button and plays a sounds when an error appears. Working at CR Version 34.0.0
// @author       jamir-boop
// @match        *://*.automationanywhere.digital/*
// @icon         https://cdn2.steamgriddb.com/icon/e16e74a63567ecb44ade5c87002bb1d9/32/32x32.png
// @grant        none
// @license      MIT
// @run-at       document-idle
// ==/UserScript==

(function () {
	"use strict";
	//============ Error sound ============
	let triggeredBadges = new Set();

	// Function to play the error sound
	function playErrorSound() {
		const audio = new Audio("data:audio/wav;base64,");
		audio.volume = 0.5;
		audio.play();
	}

	// Function to check for the specific span element with the defined classes
	function checkForErrorBadge() {
		const spans = document.querySelectorAll('span.rio-icon.rio-icon--icon_exclamation-mark--internal-use');
		spans.forEach((span) => {
			if (!triggeredBadges.has(span)) {
				console.log("Error badge found!");
				playErrorSound();
				triggeredBadges.add(span); // Mark this span as handled
			}
		});
	}

	// Set up a MutationObserver to monitor changes in the DOM
	const observer = new MutationObserver(function (mutationsList) {
		mutationsList.forEach((mutation) => {
			if (mutation.type === 'childList' || mutation.type === 'attributes') {
				checkForErrorBadge(); // Check when DOM changes occur
			}
		});
	});

	// Start observing the document body for changes
	observer.observe(document.body, {
		childList: true, // Observe direct children changes
		subtree: true,   // Observe all descendants
		attributes: true // Observe attribute changes
	});

	//============ RUN button sounds ============
	// Define buttons data
	const buttonsBase64 = {
		"buttons": [
			{
				"button10": ""
			},
			{
				"button14": ""
			},
			{
				"button15": ""
			},
			{
				"button16": ""
			},
			{
				"button17": ""
			},
			{
				"button18": ""
			},
			{
				"button1": ""
			},
			{
				"button24": ""
			},
			{
				"button3": ""
			},
			{
				"button5": ""
			},
			{
				"button6": ""
			},
			{
				"button9": ""
			}
		]
	}

	// Capture RUN button
	function captureRunButton(attempts) {
		let runButton = document.querySelector("button[name='run']");

		if (runButton) {
			console.log("Run button captured successfully.");
			addEventListenerToButton(runButton);
		} else if (attempts > 0) {
			console.log(`Run button not found. Retrying... ${attempts} attempts left.`);
			setTimeout(() => {
				captureRunButton(attempts - 1);
			}, 3000); // Wait for 3 seconds before retrying
		} else {
			console.log("Failed to capture the Run button after multiple attempts.");
		}
	}

	// Add Event listener to run button
	function addEventListenerToButton(runButton) {
		runButton.addEventListener('click', function(event) {
			event.preventDefault();
			const randomButton = buttonsBase64.buttons[Math.floor(Math.random() * buttonsBase64.buttons.length)];
			const soundKey = Object.keys(randomButton)[0];
			const audioData = randomButton[soundKey];
			const audio = new Audio("data:audio/wav;base64," + audioData);
			audio.play().then(() => {
				runButton.removeEventListener('click', arguments.callee);
				runButton.click(); // Perform the original click action after sound has played
				runButton.addEventListener('click', arguments.callee);
			});
		});
		console.log("Event listener added to the RUN button.");
	}

	// Start capturing the run button with 5 retries
	captureRunButton(5);

	let lastHref = document.location.href;
	setInterval(function () {
		const currentHref = document.location.href;

		if (lastHref !== currentHref) {
			lastHref = currentHref;
			captureRunButton(5);
		}
	}, 5000);
})();
